html{
    box-sizing: border-box;
    
    
}//sdelatb border vnytrenniy ipadding toze rozvorachivaetsya vnytrb
*,
*::after,
*::before{
    list-style-type: none;
    box-sizing: inherit;
}//kazdiy element nasledyetbsya ot roditelya
a{
    text-decoration: none;//ybiraem podcherkivanie
    color: inherit;//cvet nasledyetbsya
}
ul{
    margin: 0px;
    padding: 0px;
}
.menu_button{
    display: none;
}

body{
    color: #000;
    font-family: Comfortaa;
    // font-family: Yeseva One;
    font-size: 14px;
    font-style: normal;
    font-weight: 400;
    line-height: 1.2;
    margin: 0px;
    padding: 0px; 
}

button{
    border: 0;
    border-radius: 0;
    padding: 0;
    background-color: none;
    cursor: pointer;
}

header{
    position: fixed;
    z-index: 20;
    top: 0px;
    background-color: #FFF8F3;
    width: 100%;
    .container{
        max-width: 1180px;
        padding-left: 10px;
        padding-right: 10px;
        margin: 0 auto;
        height: 70px;
        display: flex;   
        justify-content: space-between;
        align-items: center;
        margin-top: 4px;
        nav{
            ul{
                display: flex;
                gap: 20px;
                li{
                    a{
                        text-transform: uppercase;//vesb tekst to uperCase
                    }
                }
            }
        }
        .phone{
            position: relative;//positciya stanovitslya roditelbskoy
            margin-left: 23px;
            
        
        }
        .phone::before{
            position: absolute;
            content: "";
            background-image: url(./img/phone.svg);
            width: 20px;
            height: 20px;
            left:-23px;
            top:-3px;  
            z-index: 1;
        }
        
    }
}
main{
