    .feedback{
        .container{
            max-width: 1180px;
            margin: 0 auto;
            padding: 0 10px;
            margin-top: 150px;
            position: relative;
            height: 490px;
            .feedback_content{
                .feedback_tittle{
                    font-family: Yeseva One;
                    font-size: 40px;
                    font-style: normal;
                    font-weight: 400;
                    line-height: 1.2;
                    margin: 0;
                    padding: 0;
                    padding-bottom: 15px;

                }
                .feedback_text{
                    margin: 0;
                    padding: 0;
                    width: 374px;
                }
            }
            .feedback_slider{
                position: absolute;
                    top: 0px;
                    left: 500px;
                .feedback_slider_container{
                    overflow-x:hidden;
                    position: relative;  
                    .swiper-slider{
                        display: flex;
                        transition: transform 0.3s ease-in-out;
                        gap: 150px;            
                        .swiper-slide{
                            display: flex;
                            gap: 14px;
                            width: 768px;
                            position: relative;
                            .swiper-left{
                                height: 100%;
                                width: 30%;
                                position: absolute;
                                left: 0;
                                -webkit-tap-highlight-color: transparent;//ybiraet podsvetky bkoka na plansheti pri nazatii 
                                
                            }
                            .swiper-right{
                                height: 80%;
                                width: 30%;
                                position: absolute;
                                right: 0;
                                top:0;
                                -webkit-tap-highlight-color: transparent;
                                
                            }
                            .feedback_item-img{
                                width: 380px;
                                pointer-events: none;
                                user-select: none;
                                height: 370px;
                            }
                            .feedback_item_info{
                                width: 374px;
                                position: relative;
                                .feedback_item_info-link{
                                    margin-top: 48px;
                                    display: inline-block;
                                    .feedback_item_info-img{ 
                                        pointer-events: none;
                                        user-select: none;
                                    }
                                }
                                .feedback_item_info-top{
                                    font-family: Yeseva One;
                                    font-size: 16px;
                                    font-style: normal;
                                    font-weight: 400;
                                    line-height: 1.2;
                                    padding: 0;
                                    margin: 12px 0px 15px 0px;
                                    user-select: none;
                                    cursor: default;
        
                                }
                                .feedback_item_info-bot{
                                    margin: 0;
                                    padding: 0;
                                    user-select: none;
                                    cursor: default;
                                }
                                .feedback_item_info-btn{
                                    font-family: Comfortaa;
                                    font-size: 14px;
                                    font-style: normal;
                                    font-weight: 600;
                                    line-height: normal;
                                    position: absolute;
                                    background-color: #FFBD59;
                                    width: 216px;
                                    height: 56px;
                                    right: 0;
                                    bottom: 10px;
                                    user-select: none;
                                }
                            }
                            
                        }
                    }
                }
                .swiper-indicator{
                    display: inline-flex;
                    width: 236px;
                    justify-content: space-between;
                    flex-direction: row;
                    position: absolute;
                    left: 300px;
                    bottom: -50px;     
                    .swiper-indicator-element{
                        background-color: #BEA495;
                        cursor: pointer;
                        width: 53px;
                        height: 4px;
                        
                    }
                    .swiper-indicator-element-active{         
                        background-color: #7B6152;
                        cursor: pointer;
                        width: 53px;
                        height: 4px;
                    }
                    
                }
            }
            .feedback_string{
                position: absolute;
                bottom: 10px;
                left:470px;
            }
        }
    }
    .certificat{
        .container{
            max-width: 1180px;
            margin: 0 auto;
            padding: 0 10px;
            margin-top: 150px;
            position: relative;
            height: 371px;
            .certificat_content{
                .certificat_tittle{
                    font-family: Yeseva One;
                    font-size: 40px;
                    font-style: normal;
                    font-weight: 400;
                    line-height: normal;
                    margin: 0px;
                    width: 278px;
                }
                .certificat_text{
                    margin: 0px;
                    width: 371px;
                    margin-top: 15px;

                }
            }
            .certificat_swiper_container{
                position: absolute;
                top: 0px;
                left: 400px;
                overflow-x:hidden;
                .certificat_swiper_list{
                    display: flex;
                    flex-direction: row;
                    gap: 20px;
                    transition: transform 0.3s ease-in-out;
                    .certificat_swiper_slide{
                        position: relative; 
                        user-select: none;
                        .certificat_swiper-left{
                            width: 30%;
                            height: 100%;
                            position: absolute;
                            left: 0px;
                            -webkit-tap-highlight-color: transparent;
                        }
                        .certificat_swiper-right{
                            width: 30%;
                            height: 100%;
                            position: absolute;
                            right: 0px;
                            -webkit-tap-highlight-color: transparent;
                        }
                        .certificat_swiper-img{
                            user-select: none;
                            pointer-events: none;
                        }
                    }
                }
            }
            .certificat_swiper_indicators{
                display: flex;
                width: 236px;
                position: absolute;
                flex-direction: row;
                justify-content: space-around;
                gap: 4px;
                bottom: 80px;
                left: 640px;
                .certificat_swiper_indicator-element{
                    background-color: #BEA495;
                        cursor: pointer;
                        width: 53px;
                        height: 4px;
                
                }
                .certificat_swiper_indicator-element-active{
                    background-color:#7B6152;
                    cursor: pointer;
                    width: 53px;
                    height: 4px;
                }
            }
            .certificat_string{
                position: absolute;
                bottom: 5px;
                left: 390px;
            }
            
        }
    }
}

